import React from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';
import { TweenMax, Power2 } from 'gsap';


function BasicExample() {

 React.useEffect(() => {
  TweenMax.from('.wrp-form', 2.3, { delay: 13.3, opacity: 0, x: 120, ease: Power2.ease })
 }, []);

 return (
  <div className='wrp-form'>
   <Form>
    <div class="mb-3">
     <label for="exampleFormControlInput1" class="form-label">Pseudo Agent</label>
     <input type="email" class="form-control" id="exampleFormControlInput1" placeholder="pseudo_identifiant" />
    </div>
    <Link to={'/admin'}>
     <Button variant="primary" type="submit">
      Connexion
    </Button>
    </Link>

   </Form>
  </div>
 );
}

export default BasicExample;
